import React, { Component } from 'react';
import { SubItem } from './SubItem';
import './Item.css';

export class Item extends Component {
	constructor(){
		super();
		this.state = {
			expanded:false
		}
	}

	render() {
		const subItems = this.props.subs.map((label, i) =>
			<SubItem
				key={i}
				index={i}
				left={label.category}
				right={label.amount}
			/>);

		if (subs.length != 0){
			console.log(subs);
		} else {
			console.log('no subs');
		}

		//subs.length === 0 ? createSubItems : console.log('subs');

		return (
			<div className="Item">
				<div className="col-left">
				<div className="icon icon-collapse"></div>
				{this.props.left}
				</div>
				<div className="col-right">
				{this.props.right}
				</div>
				<div>

				</div>
			</div>
		)
	}
}
